// This is Header component /Navigation Component
import React, { useState } from "react";
import { Link } from 'react-router-dom';
import logo from '../Images/Final-logo-alpha.png'
import "./Header.css"
import Menu from "../Images/menu-img.png"

const Header = () => {

  const [clicked, setclicked] = useState(false);
  const handleClick = () => {
    const mobileMenuVisibility = document.getElementById("menu-mobile").style.visibility
    clicked ? mobileMenuVisibility = "hidden" : mobileMenuVisibility = "visible";
    setclicked(!clicked);
    }

  return (
  <div id="menu">
    <div>
      <a class="logo-link">
        <Link to ="/"><img src={logo} alt="logo" /></Link>
      </a>
    </div>
    <div id="menu-buttons">
      <Link to ="/">Home</Link>
      <Link to ="/about">About</Link>
      <Link to ="/services">Services</Link>
      <Link to ="/request">
        <button class="btn-bright">Request Service</button>
      </Link>
    </div>
    <img id="img-menu-opener" src={Menu} onClick={() => handleClick() } clicked={click}/>
    <div id="menu-mobile" clicked={click}>
      <Link to ="/" onClick={() => handleClick() }>Home</Link>
      <Link to ="/about" onClick={() => handleClick() }>About</Link>
      <Link to ="/services" onClick={() => handleClick() }>Services</Link>
      <Link to ="/request" onClick={() => handleClick() }>
        <button class="btn-bright">Request Service</button>
      </Link>
    </div>
    </div>
  )
};

export default Header;
